@DichJasmin 6.30: Beide aufwecken. 
7: Mann fährt i. Arbeit
7.30: Kind fährt mit Bus in die Schule und ich falle ins Bett.

@DichJasmin 19-20Uhr: Aufstehen. Kaffee. Bissl zocken.
21 Uhr: Ich mach mich für die Arbeit fertig, geb Kind und Mann gute Nachtkuss
21.30: Komm in der Arbeit an und schau erstmal, ob Batterien voll aufgeladen sind und nehme die von der Station.
